import Head from 'next/head';
import Navbar from './Navbar';

const Layout = (props) => (
  <div>
    <Head>
      <title>BitsPrice</title>  
      <link rel="stylesheet"
      href="https://stackpath.bootstrapcdn.com/bootswatch/4.5.0/cerulean/bootstrap.min.css" />
    </Head>
    <Navbar />
    <div className="container"> 

    </div>
    {props.children}
  </div>
);

export default Layout;
